import React from "react";
import styled from "styled-components";

const StartButton = () => {
  return <Button>게임 시작</Button>;
};

export default StartButton;

const Button = styled.button`
  background-color: rgb(255, 215, 139);
  font-size: 2rem;
  font-weight: 600;
  width: 20rem;
  height: 5rem;
  margin: 15rem auto 0;
  display: block;
  border-radius: 10px;

  &:hover {
    color: white;
    background-color: orange;
  }
`;
